textOriginal:
Incrível como a CNN simplesmente não consegue ser imparcial.
Propostas do Governo Bolsonaro:
- Manutenção e fortalecimento do Plano Nacional de Enfrentamento à Violência contra Crianças e Adolescentes, criado em 2021;
- Manutenção e fortalecimento do Plano Nacional de Enfrentamento ao Feminicídio;
- Fortalecimento das ações no combate ao crime organizado e outras ameaças à segurança e defesa nacional, utilizando amplo espectro de tecnologias disponíveis, como drones, inteligência artificial e perícia forense, dentre outros, sempre em coordenação e integração entre as instituições federais e os órgãos estaduais e municipais;
Além das propostas citadas no vídeo. 

O plano de governo de Lula é, majoritariamente, formado apenas por diretrizes, com pouquíssimas propostas concretas, tal como exposto no vídeo.
